        SELECT '#FF6633' UNION ALL -- Oranye Terang
        SELECT '#FFCC33' UNION ALL -- Kuning Neon
        SELECT '#FF33FF' UNION ALL -- Fuchsia Terang
        SELECT '#CCFF33' UNION ALL -- Hijau Kuning
        SELECT '#99FF66' UNION ALL -- Lime Terang
        SELECT '#66FF99' UNION ALL -- Hijau Terang
        SELECT '#33FF33' UNION ALL -- Hijau Terang
        SELECT '#66FFFF' UNION ALL -- Cyan Neon
        SELECT '#99FF33' UNION ALL -- Lime Terang
        SELECT '#FF33FF' UNION ALL -- Fuchsia Terang
        SELECT '#33FF99' UNION ALL -- Hijau Terang
        SELECT '#33CCFF' UNION ALL -- Biru Terang
