        SELECT '#66FF99' UNION ALL -- Neon Hijau
        SELECT '#66FFCC' UNION ALL -- Neon Cyan
        SELECT '#66FFFF' UNION ALL -- Neon Cyan
        SELECT '#99FF33' UNION ALL -- Lime Terang
        SELECT '#99FF66' UNION ALL -- Lime Terang
        SELECT '#FF5733' UNION ALL -- Merah Terang
        SELECT '#FFC300' UNION ALL -- Kuning Terang
        SELECT '#FF33FF' UNION ALL -- Pink Terang
        SELECT '#33FF33' UNION ALL -- Hijau Terang
        SELECT '#3399FF' -- Biru Terang
    ) colors;

    OPEN colors;
    FETCH colors INTO color;

    -- Perulangan untuk memasukkan warna berdasarkan id_desa
